import React from 'react'
import data from '../businesses.json'

export default function BusinessMap() {

    const tagMap = (arr) => {
        console.log(arr)
        arr.map((tag) => {
            return (
                <li> "#" + {tag}</li>
            )
        })
    }




    const map = data.map((business) => {

        const tags = tagMap(business.businessType)

        return (
                    <li key={business.distance} className="list">
                        <div className="side-card">
                            <h5>
                                {business.name}
                            </h5>
                            <p>
                                {business.address}
                            </p>
                            <ul>   
                                {tags}
                            </ul> 
                        </div>
                    </li>
            )
        }
    )

    return (
        <ul className ="list-ul">
            {map}
        </ul>
    )
}
